import './login.css'

function Login()
{
    const gotologin = () =>
    {
        alert("clicked on login");
    }
    const gotosignin = () =>
    {
        alert("clicked on signin");
    }
    return(
        <div id = "login-box">
            <button id='login' onclick = {gotologin}>Log in</button>
            <button id='signup'>Sign up</button>
            <br></br>
            <div id = "form">
                <label id='label1'>Username:</label><br/>
                <input type="text" placeholder='username' />
                <br/><br/><br/><br/>
                <label id='label2'>Password:</label><br/>
                <input type="password" placeholder='password' /><br/>
                <button id='submit'>Login</button>
                
            </div>
        </div>
    )
}

export default Login;
